import React from 'react'
import {Octicons} from '@expo/vector-icons';
export default function SignOut() {
    function onSignOut(){
        console.log();
        return
    }
    return (
        <div>
            <Octicons onClick ={() => onSignOut} name = "sign-out" size = {22} color = {'white'}/>
        </div>
    )
}
